es outlined in the\\\\u00a0<a href=\\\\\\"https://docs.google.com/document/d/1Zgr-sqQiZ6Kf32SUrt1gD8vXS9QXz7T04IGVcownmUc/edit?usp=sharing\\\\\\">Member Guide</a>.</p><ul>\\\\n<li>Single-session class or workshop<ul>\\\\n<li>If canceled 72 hours or more before the scheduled date, the participant will have the option to receive a refund, or have their registration moved to another class or workshop.</li>\\\\n<li>If canceled within 72 hours of the scheduled date, no refund will be provided, but the participant may choose to have their registration moved to another class or workshop or to receive a credit on their account.</li>\\\\n</ul>\\\\n</li>\\\\n<li>Multi-session class or workshop<ul>\\\\n<li>If canceled 1 week (7 days) prior to the start date, the participant will have the option to receive a refund or account credit minus a $35 cancellation fee, or to have their registration moved to another multi-session class or workshop, if available.</li>\\\\n<li>If canceled less than 1 week (7 days) prior to the start date, no refund will be provided, but the participant will receive a credit on their account, minus a $75 cancellation fee.\\\\u00a0\\\\u00a0</li>\\\\n</ul>\\\\n</li>\\\\n</ul>\\\\n<p>If a participant is a no-show, no refunds, credits, or transfers (rescheduling) will be given.\\\\u00a0Please be aware that there are no exceptions to these cancellation policies.\\\\u00a0<strong>Classes may be cancelled due to low enrollment.</strong></p>\\", \\"financialSettings\\": {\\"admissionFee\\": null, \\"feeType\\": \\"MT_OA\\", \\"fund\\": null, \\"taxDeductiblePortion\\": null, \\"ticketsPerRegistration\\": null}, \\"location\\": {\\"address\\": \\"214 N Trenton Ave.\\", \\"city\\": \\"Pittsburgh\\", \\"name\\": \\"Protohaven\\", \\"stateProvince\\": {\\"name\\": \\"Pennsylvania\\"}, \\"zipCode\\": \\"15221\\"}, \\"maximumAttendees\\": 4, \\"name\\": \\"Plastics 101: Shredder, Dryer, and Injection Molder Clearance\\", \\"publishEvent\\": true, \\"summary\\": \\"Plast