adt80ryns6p2yxfka	admin@example.com	::ffff:172.24.0.1	brtgkdp6hqjcval	p5505lo0x0b4yuj	mjxxyvyn5a8qegm	12	DATA_DELETE	\N	\N	\N	{"data":{"eventId":"54559","data":{"archived":false,"category":{"id":"16"},"createAccountsforAttendees":true,"enableEventRegistrationForm":true,"enableWaitListing":false,"eventDates":{"endDate":"2025-05-07","endTime":"9:00 PM","registrationCloseDate":"2025-05-06T18:00:00-04:00","registrationOpenDate":"2025-04-18T16:35:58.141724","startDate":"2025-05-07","startTime":"6:00 PM","timeZone":{"id":"1"}},"eventDescription":"<p><img height=\\"200\\" src=\\"https://d2r0txsugik6oi.cloudfront.net/neon/resource/protohaven/images/class_plastic101.jpg\\"/></p>\\n<p>Turn your plastic trash into something beautiful and new! In this class, we'll walk through the process of recycling used plastic - from grinding, to dehydrating, to injecting. Our focus will be on using the injection molder to turn your shredded plastic waste into something useful, new, and eye-catching. We'll also learn about different types of plastic, how it is (and is not) recycled, and talk about other ways to reduce your plastic use and join the plastics recycling community.</p>\\n<p><strong>What you Will Create</strong></p>\\n<p>You can choose any project from our library of injection molds!</p>\\n\\n<p><strong>What to Bring/Wear</strong></p>\\n<p>Feel free to bring one (1) brown paper-bag worth of CLEAN #5 (PP) and #2 (HDPE) plastic. Fun colors are encouraged!\\nClosed-toed shoes. Long sleeves and hair will need to be pulled back.</p>\\n\\n<p><strong>Age Requirement</strong></p>\\n<p>Open to ages 16+. Class participants that are 12-17 years old must have a parent present at Protohaven for the duration of the class. </p><p>All members, visitors, and class participants are expected to abide by Protohaven rules and guidelines outlined in the <a href=\\"https://docs.google.com/document/d/1Zgr-sqQiZ6Kf32SUrt1gD8vXS9QXz7T04IGVcownmUc/edit?usp=sharing\\">Member Guide</a>.</p><ul>\\n<li>Single-session class or workshop<ul>\\n<li>If canceled 72 hours or more before the scheduled date, the participant will have the option to receive a refund, or have their registration moved to another class or workshop.</li>\\n<li>If canceled within 72 hours of the scheduled date, no refund will be provided, but the participant may choose to have their registration moved to another class or workshop or to receive a credit on their account.</li>\\n</ul>\\n</li>\\n<li>Multi-session class or workshop<ul>\\n<li>If canceled 1 week (7 days) prior to the start date, the participant will have the option to receive a refund or account credit minus a $35 cancellation fee, or to have their registration moved to another multi-session class or workshop, if available.</li>\\n<li>If canceled less than 1 week (7 days) prior to the start date, no refund will be provided, but the participant will receive a credit on their account, minus a $75 cancellation fee.  </li>\\n</ul>\\n</li>\\n</ul>\\n<p>If a participant is a no-show, no refunds, credits, or transfers (rescheduling) will be given. Please be aware that there are no exceptions to these cancellation policies. <strong>Classes may be cancelled due to low enrollment.</strong></p>","financialSettings":{"admissionFee":null,"feeType":"MT_OA","fund":null,"taxDeductiblePortion":null,"ticketsPerRegistration":null},"location":{"address":"214 N Trenton Ave.","city":"Pittsburgh","name":"Protohaven","stateProvince":{"name":"Pennsylvania"},"zipCode":"15221"},"maximumAttendees":4,"name":"Plastics 101: Shredder, Dryer, and Injection Molder Clearance","publishEvent":true,"summary":"Plastics 101: Shredder, Dryer, and Injection Molder Clearance"}},"column_meta":{"eventId":{"id":"csibxo15cwixq53","title":"eventId","type":"SingleLineText","options":{"default_view_col_visibility":true}},"data":{"id":"csn24cjx48k0e6g","title":"data","type":"JSON","options":{}}},"table_title":"events"}	2025-04-18 20:35:58+00	2025-04-18 20:35:58+00	1	usgqm1d1wjuj7zj4	\N	adt1bj