adtq3x05cexaffyhw	admin@example.com	::ffff:172.22.0.1	brtgkdp6hqjcval	p5505lo0x0b4yuj	mjxxyvyn5a8qegm	1	DATA_UPDATE	\N	\N	\N	{"old_data":{"fetch_data":null},"data":{"fetch_data":{"id":"18001","name":"Graphics 110: Heat Transfer Vinyl T-Shirt (Vinyl Cutter Clearance)","summary":"Graphics 110: Heat Transfer Vinyl T-Shirt (Vinyl Cutter Clearance)","code":"","maximumAttendees":6,"category":{"id":"15","name":"Project-Based Workshop","status":null},"topic":null,"campaign":null,"publishEvent":false,"enableEventRegistrationForm":false,"archived":false,"enableWaitListing":false,"createAccountsforAttendees":true,"eventDescription":"<p class='neonBody'><img height=\\"200\\" src=\\"https://d2r0txsugik6oi.cloudfront.net/neon/resource/protohaven/images/class_graphics110.jpg\\" /></p>\\r\\n\\r\\n<p class='neonBody'>Using the versatile CNC vinyl cutter in tandem with our heat press machine, we will create professional-quality custom t-shirts. We will begin with each student designing a simple file using a template in Inkscape - a powerful vector drawing software. Next, we will take our files to the CNC vinyl cutter, where each student will be able to cut their file on the vinyl cutter with instructor guidance. Next, we will apply our cut designs onto t-shirts to be pressed using our state-of-the-art heat press. Not only will you learn how to use the CNC vinyl cutter and heat press independently as a Protohaven member, you will learn how to design simple vector files in Inkscape. You will also gain experience in how to use this simple process to make heat press apparel for yourself, as gifts, or as branding for your small business.</p>\\r\\n\\r\\n<p class='neonBody'><strong>What to Bring/Wear</strong></p>\\r\\n\\r\\n<p class='neonBody'>Students must bring their own shirts for this class. 100% cotton or 50/50 polyblend material is acceptable. Please no 100% synthetic material - it will not work!</p>\\r\\n\\r\\n<p class='neonBody'><strong>Clearances Earned</strong></p>\\r\\n\\r\\n<p c