58	2025-03-19 15:21:12	2025-03-24 21:25:14	usgqm1d1wjuj7zj4	usgqm1d1wjuj7zj4	3	recDfgX83pSzVlNqn	b6ecee4df9ef07da80ef2b00317a3c913db76198	Smithing 110: Decorative Hooks (Forge Clearance)	<p class="neonBody">Learn to forge, finesse, and finish steel while crafting a hand forged, custom decorative steel hook in this blacksmithing intro!</p>\n\n<p class="neonBody">You&rsquo;ll learn how to operate a blacksmithing forge using a suite of critical hand tools (like hammers, tongs, and vices) to heat steel; how to flatten, twist, and shape steel at the anvil; and how to finish your work with natural waxes and oils to obtain the blackened patina commonly associated with Blacksmithing. Whether you&rsquo;re already a member or choose to become one in the future, taking this class will gain you clearance to use our Blacksmithing Forge independently.</p>\n\n<h4>Tools we&rsquo;ll cover:</h4>\n\n<ul>\n\t<li>2 burner Forge</li>\n\t<li>Anvil</li>\n\t<li>Hammers</li>\n\t<li>Tongs</li>\n\t<li>Vices</li>\n</ul>\n\n<h4>Materials included:</h4>\n\n<ul>\n\t<li>1/4&quot; Steel Bar</li>\n\t<li>Wax &amp; Oil Finishes</li>\n</ul>\n	Forge	4	93	3	1	Closed-toed shoes. Long sleeves and hair will need to be pulled back.\n	Hand-forged decorative hooks	16+	Learn to forge, finesse, and finish steel while crafting a hand forged, custom decorative steel hook in this blacksmithing intro!\nYou’ll learn how to operate a blacksmithing forge using a suite of critical hand tools (like hammers, tongs, and vices) to heat steel; how to flatten, twist, and shape steel at the anvil; and how to finish your work with natural waxes and oils to obtain the blackened patina commonly associated with Blacksmithing. Whether you’re already a member or choose to become one in the future, taking this class will gain you clearance to use our Blacksmithing Forge independently.\n\n	t	\N	13	12.00	0	t	https://d2r0txsugik6oi.cloudfront.net/neon/resource/protohaven/images/class_smithing110.png	\N
